import React from 'react'
class Api extends React.Component {
    constructor() {
    super()
    this.state = {
        apiPredictionData: {},
        urlData : {
            PassengerId:5,
            Pclass:3,
            SexMale:1.0,
            SexFemale:0.0,
            Age:35.0,
            SibSp:0,
            Parch:0,
            Fare:8.0500,
            EmbarkedS:1.0,
            EmbarkedC:0.0,
            EmbarkedQ: 0.0
    },
    url : "/api/predict?"
    }
    this.click = this.click.bind(this)
}


    componentDidMount() {
        let ourl = this.state.url
        let i = 1
        for(let key in this.state.urlData) {
            // console.log(i)
            ourl += "v"+ i++ + "=" + this.state.urlData[key] + "&"
        }
        this.setState({ 
            url: ourl.slice(0,-1)
        })
        fetch(this.state.url)
        .then(response => response.json())
        // .then(data => 
    }

    click() {
        fetch(this.state.url)
        .then(response => response.json())
        .then(data => this.setState({
            apiPredictionData: data
        }))
    }


    render() {
        console.log(this.state.url)
        console.log(this.state.apiPredictionData.predicted)
        // console.log(typeof(JSON.parse(this.state.apiData.python)))
        return(

            <div>
                <button onClick={this.click}>click</button>
               <h2>{this.state.apiPredictionData.predicted }{this.state.url}</h2>
            </div>
        )
    }

}




export default Api
